import "../../css/app.css";
import { useSelector, useDispatch } from "react-redux";
import { getData } from "../features/gameSlice";

export const Game = () => {
    const dispatch = useDispatch();

    // state
    const gameState = useSelector(state => state.data);

    // Effects
    useEffect(() => {
        dispatch(getData(gameState.endpoint));
    }, [dispatch]);

